import React, { Component } from "react";
import { Route, Routes } from "react-router-dom";
import CreateProject from './create-project/CreateProject';
import Navbar from './navigation/Navbar';
import AllProjects from "./all-projects/AllProjects";
import IndividualProjectTemplate from "./individual-project/IndividualProjectTemplate"; // Импорт на новия компонент

class App extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <div className="container mt-3">
          <Routes>
            <Route path="/" element={<div>Welcome to Build Ledger!</div>} />
            <Route path="/create-project" element={<CreateProject />} />
            <Route path="/all-projects" element={<AllProjects />} />
            <Route path="/project/:id" element={<IndividualProjectTemplate />} /> {/* Път за всеки отделен проект */}
            <Route path="*" element={<div>404 Not Found</div>} />
          </Routes>
        </div>
      </div>
    );
  }
}

export default App;
